import React from 'react'

var Circle = require('rc-progress').Circle;

class Circle_c extends React.Component{
    constructor(){
        super();
        this.state = {
            color: ""
        }
    }

    render(){
        var percent = this.props.vote_average*10
        if(this.props.vote_average < 3){
            this.setState({
                color:"#ff0000"
            })
        }else if(this.props.vote_average < 9 && this.props.vote_average > 6){
            this.setState({
                color:"#FFFF00"
            })
        }else{
            this.setState({
                color:"#7CFC00"
            })
        }

        return(
            <div>
                <Circle percent={percent} style={{width:"50px", marginLeft:"20px"}} strokeWidth="15" strokeColor={this.state.color} />
            </div>
        )
    }
}

export default Circle_c
